import React from "react";
import styled from "styled-components";

const FotterContainer = styled.div`
  width: 100%;
  height: 300px;
  background: gray;
  border-top-right-radius: 10px;
`;

const Fotter = () => {
  return <FotterContainer></FotterContainer>;
};

export default Fotter;
